import './App.css';

function App() {
  const data = [
    {home:"Home", band:'Band', tour:"Tour", contact : 'Contact'}
  ];
  return (
    <div className='App container'>
      <Navigation value={data[0].home} valueone={data[0].band} valuetwo={data[0].Tour} valuethree={data[0].Contact}/>
    </div>
  );
}
export default App;
